  return (
    <div className='mainDiv'>
    <h2 className='title'>Smart house</h2>
    <Link to={'/addroom'}><button className='btn'>+</button></Link>
    
   
    {console.log(props.rooms)}
    
            {props.rooms.map((val)=>{
                return <button style={{backgroundColor: val.color}}> <p>{val.name}</p> </button>
              })}
    
    
     
    
        
    </div>
  )
}
